import { memo } from "react";
import { PlaneBufferGeometry, MeshBasicMaterial, Mesh } from "three";

export const Photo = memo(({ x, y, texture }) => {
  return (
    <mesh position={[x, y, 0]}>
      <planeBufferGeometry args={[1, 1]} />
      <meshBasicMaterial map={texture} />
    </mesh>
  );
});
